import styled from "styled-components";

const NotFoundContainer = styled.div`
  display: flex;
  -ms-flex-direction: column;
  flex-direction: column;
  -ms-flex-pack: center;
  justify-content: center;
  -ms-flex-align: center;
  align-items: center;
  height: 90vh;
`;

export default NotFoundContainer;
